import React from 'react';
import { useNavigate } from 'react-router-dom';


function Home() {
    const navigate = useNavigate();

    return (
         <center>
            <h1>welcome to home</h1>
            <button onClick={navigate("/")}>Logout</button>
         </center>
    );
}

export default Home;
